import DragDropFile from './DragDropFile';
import { useState, useEffect } from 'react'


const Upload = () => {
    const [processedImages, setProcessedImages] = useState(null);
    const [imageProcessing, setImageProcessing] = useState(true);

    useEffect(() => {
        setTimeout(function () {
          console.log("Delayed for 5 second.");
          setImageProcessing(false);
        }, 5000);
      }, []);

    if (!processedImages) {
        return (
        <div>  
            <DragDropFile setProcessedImages={setProcessedImages} setImageProcessing={setImageProcessing}/>
        </div>);
    } else {

        return (
            <div>
                    <section className='output-container'>
                     <div className='output-container-detail'>
                        <div className="row">
                            {processedImages.map(item => {
                                    return (
                                        <div className="method-col">
                                            <img src={item} alt="" />
                                            <div className="layer"> </div>
                                        </div>)
                                })}
                        </div>


                     </div>
                    </section>
                <section className="scanningmethods">
                    <p>Detected photos: </p>

                    <div className="pizza"> 
                    <div className="row">
                        {processedImages.map(item => {
                                return (
                                    <div className="method-col">
                                        <h3 className='outputTitle'>Image </h3>
                                        <img src={item} alt="" />
                                        <div className="layer"> </div>
                                    </div>)
                            })}
                    </div>
                    </div>
                </section>
            </div>
        )
    }
};

export default Upload;
